const About = () => {

    return (
      <div className="About">
        <h2>About</h2>
        <br />
        <p>Hi, my name is Aviv Hagag, a software engineer.</p>
        <p>This project is a part of my homework for a hiring opportunity. in this project, you can take 5 files and use chatGPT to compare the reviews between different products and identify differences or similarities in how the model responds to the reviews.</p>
      </div>
    );
  }

  export default About;
